import subprocess, sys
failures = []
for A in range(1, 101):
    for B in range(1, 101):
        # compute expected
        expected = 0
        xs = set()
        for x in range(-1000, 1001):
            arr = [A,B,x]
            ok = False
            from itertools import permutations
            for p,q,r in permutations(arr, 3):
                if q - p == r - q:
                    ok = True
                    break
            if ok:
                xs.add(x)
        expected = len(xs)
        # run solution.py
        proc = subprocess.run([sys.executable, '/workspace/solution.py'], input=f"{A} {B}\n", text=True, capture_output=True)
        out = proc.stdout.strip()
        try:
            got = int(out)
        except:
            failures.append((A,B,'non-int-output',out))
            continue
        if got != expected:
            failures.append((A,B,got,expected))

if not failures:
    print('ALL_OK')
else:
    print('FAILURES', len(failures))
    for f in failures[:10]:
        print(f)
